const fbIcon = '/Assets/Images/facebook.svg'
const instIcon = '/Assets/Images/instagram.svg'
const beIcon = '/Assets/Images/behance.svg'

export const Socials = [
  {
    href: '/',
    src: fbIcon,
    label: 'Facebook'
  },
  {
    href: '/',
    src: instIcon,
    label: 'Instagram'
  },
  {
    href: '/',
    src: beIcon,
    label: 'Behance'
  }
]
